import React from 'react';
import Product from './Product';
import data from './vschoolProducts';


function App(){

  const components =data.map((item)=>{
            return <Product name={item.name} price={item.price} description={item.description}/>
  });

  return(
    <div>
      {components}
    </div>
  );
}

export default App;
